import { useEffect, useState } from "react";
import "./HomePage.css";
import NavBar from "./NavBar";
import Slider from "./Slider";
import RowSlide from "./RowSlider";

function HomePage() {
  return (
    <div className="home_box">
      <NavBar />
      <Slider />
      <RowSlide />
    </div>
  );
}
export default HomePage;
